import React from 'react';
import './product.css'
function App() {
  return (
    <div className="App">
      <img src={require('./Assets/Images/VectorTopLeft.png')} alt='plant'></img>
      <img src={require('./Assets/Images/VectorMidRight.png')} alt='plant'></img>
      <img src={require('./Assets/Images/VectorTopMid.png')} alt='plant'></img>
      <img src={require('./Assets/Images/VectorMidMid.png')} alt='plant'></img>
      <img src={require('./Assets/Images/VectorMidLeft.png')} alt='plant'></img>

    </div>
  );
}

export default App;
